es/IOwnerManager.sol":"IOwnerManager"},"evmVersion":"istanbul","libraries":{},"metadata":{"bytecodeHash":"ipfs","useLiteralContent":true},"optimizer":{"enabled":false,"runs":200},"remappings":[]},"sources":{"contracts/interfaces/IOwnerManager.sol":{"content":"// SPDX-License-Identifier: LGPL-3.0-only
